    false,nt"url": null,nt"notes": "This shapefile is an vegetation map of
    Booker T. Washington National Monument, Virginia. It was developed by The Virginia
    Department of Conservation and Recreation, Division of Natural Heritage in cooperation
    with North Carolina State University's Center for Earth Observation for the Northeast
    Region of the National Park Service. The data was created following general guidelines
    set forth by the USGS-NPS Vegetation Mapping Program. Map classes are crosswalked
    to the U.S. National Vegetation Classification (USNVC) or level II of the Andersons
    land use land cover classification system. Crosswalks to the USNVC were determined
    on February 20, 2007. The map is based on field work performed in the summer of
    2002 and photo interpretation of aerial photo mosaics produced by North Carolina
    State University Center for Earth Observation from photography obtained in October
    2001 and February 2002.",nt"license_title": null,nt"extras": [{ntt"key":
